import { Link } from "react-router-dom";
import Logo from "../../assets/lightCubeLogo.png";
import { useState } from "react";

const Navigator = () => {
  const [navOpen, setNavOpen] = useState(true);

  const navToggle = () => {
    setNavOpen((navOpen) => !navOpen);
  };

  return (
    <header className="fixed left-0 bottom-3 w-full px-12 text-center">
      <div
        className={`bg-slate-900 inline-flex items-center justify-center p-1 border-2 min-w-[48px] transition-all ${
          navOpen ? "w-full" : "w-auto"
        } border-slate-50 rounded-full`}
      >
        <button onClick={navToggle}>
          <img src={Logo} alt="logo" className="w-8" />
        </button>
      </div>
    </header>
  );
};

export default Navigator;
